import React from 'react';
import '../styles/App.css';

const News = () => {
  return (
    <main className="news-container">
      <h1>News</h1>

      <div className="instagram-feed">
        <h2>Follow on Instagram</h2>
        <a href="https://www.instagram.com/cakenygardart/" className="instagram-link" target="_blank" rel="noopener noreferrer">@cakenygardart</a>

        {/* Instagram feed placeholder */}
        <div className="instagram-grid">
          {/* Instagram posts will be displayed here */}
          <div className="instagram-item">
            <a href="https://www.instagram.com/cakenygardart/" target="_blank" rel="noopener noreferrer">
              <img src="/images/insta-placeholder.jpg" alt="Instagram post" />
            </a>
          </div>
          {/* Add more Instagram items as needed */}
        </div>
      </div>
    </main>
  );
};

export default News;
